import com.eviware.soapui.support.XmlHolder

def firstname =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("firstname")
def lastname =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("lastname")
def dob =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("dob")
def regionCode =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("regionCode")
def region =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("region")
def countryId =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("countryId")
def item =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("item")
def telephone =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("telephone")
def postcode =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("postcode")
def city =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("city")
def firstname_add =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("firstname_add")
def lastname_add =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("lastname_add")
def defaultShipping =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("defaultShipping")
def defaultBilling =  testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["TC01_Properties"].getPropertyValue("defaultBilling")
def createcustomerrequest = testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["CreateCustomer"].getPropertyValue("request")
def xmlcreatecustomer = new XmlHolder(createcustomerrequest)
xmlcreatecustomer.setNodeValue("//customer/firstname", firstname)
xmlcreatecustomer.setNodeValue("//customer/lastname", lastname)
xmlcreatecustomer.setNodeValue("//customer/dob", dob)
xmlcreatecustomer.setNodeValue("//customer/addresses/item/region/regionCode", regionCode)
xmlcreatecustomer.setNodeValue("//customer/addresses/item/region/region", region)
xmlcreatecustomer.setNodeValue("//customer/addresses/item/countryId", countryId)
xmlcreatecustomer.setNodeValue("//customer/addresses/item/street/item", item)
xmlcreatecustomer.setNodeValue("//customer/addresses/item/telephone", telephone)
xmlcreatecustomer.setNodeValue("//customer/addresses/item/postcode", postcode)
xmlcreatecustomer.setNodeValue("//customer/addresses/item/city", city)
xmlcreatecustomer.setNodeValue("//customer/addresses/item/firstname", firstname_add)
xmlcreatecustomer.setNodeValue("//customer/addresses/item/lastname", lastname_add)
xmlcreatecustomer.setNodeValue("//customer/addresses/item/defaultShipping", defaultShipping)
xmlcreatecustomer.setNodeValue("//customer/addresses/item/defaultBilling", defaultBilling)
def updatedXmlCreateCustomer = xmlcreatecustomer.getXml()
testRunner.testCase.testSuite.testCases["TC01_Customer"].testSteps["CreateCustomer"].setPropertyValue("request", updatedXmlCreateCustomer)

