import groovy.sql.Sql

//Connection  Driver ,username , password, URL
def url = 'jdbc:mysql://localhost:3306/customer'
def user = 'root'
def password = 'root'
def driver = 'com.mysql.jdbc.Driver'

//Register to MYSQL JDBC Driver- For Groovy to send and Recieve
com.eviware.soapui.support.GroovyUtils.registerJdbcDriver(driver)

//coonect to SQL instance
def sql = Sql.newInstance(url,user,password,driver)
def sku
def name
def attributeSetId
def price
def typeId

sql.eachRow("select * from product_list")
{
	row ->
	sku = "$row.sku";
	name= "$row.name";
	attributeSetId = "$row.attributeSetId";
	price = "$row.price";
	typeId = "$row.typeId";
}
sql.close()

def tc_prop = testRunner.testCase.testSuite.project.testSuites["Test_Suite"].testCases["TC03_Product"].testSteps["TC03_Properties"]
tc_prop.setPropertyValue("sku",sku)
tc_prop.setPropertyValue("name",name)
tc_prop.setPropertyValue("attributeSetId",attributeSetId)
tc_prop.setPropertyValue("price",price)
tc_prop.setPropertyValue("typeId",typeId)
